import React from "react";
import Button from "@material-ui/core/Button";
import Fade from "react-reveal/Fade";
import {
  faDesktop,
  faCamera,
  faFileAlt,
  faTabletAlt,
  faDiceD20,
  faLaptopCode,
  faHeartbeat,
  faGlobe,
  faMobileAltAlt,
} from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import ProjectCard from "./cards/ProjectCard";
import { faGithub } from "@fortawesome/free-brands-svg-icons";
import ReactGA from "react-ga";
import "../static/css/Projects.css";

export default function Projects() {
  return (
    <div className="section projects">
      <h2 className="section-heading">Projects</h2>
       <div className="more-projects">
          <ReactGA.OutboundLink
            eventLabel="Socials: Github [from Projects]"
            to="https://github.com/diegomtzg"
            target="_blank"
            rel="noopener noreferrer"
          >
            <Button className="section-button">
              <FontAwesomeIcon className="more-icon" icon={faGithub} />
              View More Projects
            </Button>
          </ReactGA.OutboundLink>
        </div>

      <Fade bottom cascade>
        <div className="projects-grid">




          <ProjectCard
            projectInfo={{
              name: "ScreenBacklight",
              link: "https://github.com/diegomtzg/ScreenBacklight",
              icon: faLaptopCode,
              desc:
                "Ambient lighting system with multiple operation modes to enhance movie viewing and music listening experience.",
             skills: ["Php", "Bootstrap"],
            }}
          />
          <ProjectCard
            projectInfo={{
              name: "ScreenBacklight",
              link: "https://github.com/diegomtzg/ScreenBacklight",
              icon: faLaptopCode,
              desc:
                "Ambient lighting system with multiple operation modes to enhance movie viewing and music listening experience.",
             skills: ["Php", "Bootstrap"],
            }}
          />
          <ProjectCard
            projectInfo={{
              name: "Udhaar",
              link: "https://github.com/diegomtzg/ScreenBacklight",
              icon: faMobileAlt,
              desc:
                "Ambient lighting system with multiple operation modes to enhance movie viewing and music listening experience.",
             skills: ["Php", "Bootstrap"],
            }}
          />
          <ProjectCard
            projectInfo={{
              name: "Ugao.pk",
              link: "https://github.com/diegomtzg/ScreenBacklight",
              icon: faMobileAlt,
              desc:
                "Ambient lighting system with multiple operation modes to enhance movie viewing and music listening experience.",
             skills: ["Php", "Bootstrap"],
            }}
          />
          <ProjectCard
            projectInfo={{
              name: "E.R.I.M.S",
              link: "https://github.com/diegomtzg/ScreenBacklight",
              icon: faMobileAlt,
              desc:
                "Ambient lighting system with multiple operation modes to enhance movie viewing and music listening experience.",
             skills: ["Php", "Bootstrap"],
            }}
          />
          <ProjectCard
            projectInfo={{
              name: "Easypaisa.com.pk",
              link: "https://easypaisa.com.pk/",
              icon: faGlobe,
              desc:
                "Brand website for Easypaisa by Telenor Microfinance Bank. ",
              skills: ["Php", "JQuery"],
            }}
          />
          <ProjectCard
            projectInfo={{
              name: "Adravaline.com",
              link: "https://adraveline.com/",
              icon: faGlobe,
              desc:
                "Ambient lighting system with multiple operation modes to enhance movie viewing and music listening experience.",
             skills: ["React JS", "Bootstrap"],
            }}
          />
          <ProjectCard
            projectInfo={{
              name: "2Vec.com",
              link: "/2vec.png",
              icon: faGlobe,
              desc:
                "Ambient lighting system with multiple operation modes to enhance movie viewing and music listening experience.",
             skills: ["Javascript","Bootstrap"],
            }}
          />
          <ProjectCard
            projectInfo={{
              name: "Lauzaafs.com",
              link: "/lauzaafs.png",
              icon: faGlobe,
              desc:
                "Ambient lighting system with multiple operation modes to enhance movie viewing and music listening experience.",
             skills: ["React JS", "Bootstrap"],
            }}
          />
          <ProjectCard
            projectInfo={{
              name: "Online Resume",
              link: "https://ammadumar.netlify.app/",
              icon: faGlobe,
              desc:
                "Ambient lighting system with multiple operation modes to enhance movie viewing and music listening experience.",
             skills: ["Javascript","Bootstrap"],
            }}
          />

        </div>

       </Fade>
    </div>
  );
}
